{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/aibamayaalvarez/bellabeat?scriptVersionId=120519871\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"804a173a","metadata":{"papermill":{"duration":0.106712,"end_time":"2023-02-27T17:06:56.172575","exception":false,"start_time":"2023-02-27T17:06:56.065863","status":"completed"},"tags":[]},"source":["# Bellabeat Case Study\n","#### author: Aibamaya Alvarez\n","#### date: 2/22/2022\n","<br>\n","<style>\n","  body{\n","    text-align : justify \n","  }\n","</style>\n","Welcome to the Bellabeat data analysis case study!\n","This case study analyzes smart device ﬁtness data to help unlock new growth opportunities for the Bellabeat company. The insights discovered will help guide a marketing strategy for the company.\n","\n","## About the company \n","\n","[Bellabeat](https://bellabeat.com/) is a high-tech company that manufactures health-focused smart products including, the Bellabeat app, Leaf, Time, and Spring. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their health and habits. Bellabeat also offers a subscription-based membership program for users, giving them access to personalized guidance on having a healthy lifestyle. All of this has positioned itself as a tech-driven wellness company for women.\n","<br>\n","\n","### Characters and Products \n","\n","##### Characters:\n","* Urška Sršen: Bellabeat’s co founder and Chief Creative Oﬃcer\n","* Sando Mur: Mathematician and Bellabeat co-founder\n","* Marketing Analytics team: A team of data analysts responsible for collecting,  analyzing, and reporting data that helps guide Bellabeat’s marketing strategy\n","\n","##### Products:\n","* **Bellabeat app**: The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.\n","* **Leaf**: Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","* **Time**: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide insights into your daily wellness.\n","* **Spring**: This water bottle tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.\n","* **Bellabeat membership**: Bellabeat also oﬀers a subscription-based membership program for users. Membership gives users 24/7 access to fully personalized guidance on nutrition, activity, sleep, health, beauty, and mindfulness-based on their lifestyle and goals.\n","<br>"]},{"cell_type":"markdown","id":"4c46092d","metadata":{"papermill":{"duration":0.103406,"end_time":"2023-02-27T17:06:56.380419","exception":false,"start_time":"2023-02-27T17:06:56.277013","status":"completed"},"tags":[]},"source":["## Business task\n","\n","Analyze smart device usage of an existing competitor to identify how consumers use non-Bellabeat devices. Then identify potential opportunities for growth and recommendations for the Bellabeat marketing strategy improvement based on the insights of that analysis.\n","\n","### Questions for the analysis\n","\n","1. What are some trends in smart device usage?\n","2. How could these trends apply to Bellabeat customers?\n","3. How could these trends help inﬂuence Bellabeat marketing strategy?\n","<br>"]},{"cell_type":"markdown","id":"dbda8e4d","metadata":{"papermill":{"duration":0.105416,"end_time":"2023-02-27T17:06:56.590016","exception":false,"start_time":"2023-02-27T17:06:56.4846","status":"completed"},"tags":[]},"source":["## Data selection\n","\n","The data for this analysis is the [Fitbit Fitness Tracker Data](https://www.kaggle.com/arashnic/fitbit) stored on Kaggle and made available by [Mobius](https://www.kaggle.com/arashnic). This dataset is under CC0: Public Domain license meaning the creator has waived his right to the work under copyright law.\n","\n","This data set contains a personal ﬁtness tracker from thirty ﬁtbit users. It includes information about daily activity, steps, and heart rate that can be used to explore users’ habits. It was generated via a survey through Amazon Mechanical Turk between 12.03.2016 and 12.05.2016. Thirty eligible Fitbit users consented to submit their tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. Variation between output represents different Fitbit trackers and individual tracking behaviors/preferences.\n","\n","The dataset has the following 18 files in .csv format.\n","\n","1. dailyActivity_merged.csv\n","2. dailyCalories_merged.csv\n","3. dailyIntensities_merged.csv\n","4. dailySteps_merged.csv\n","5. heartrate_seconds_merged.csv\n","6. hourlyCalories_merged.csv\n","7. hourlyIntensities_merged.csv\n","8. hourlySteps_merged.csv\n","9. minuteCaloriesNarrow_merged.csv\n","10. minuteCaloriesWide_merged.csv\n","11. minuteIntensitiesNarrow_merged.csv\n","12. minuteIntensitiesWide_merged.csv\n","13. minuteMETsNarrow_merged.csv\n","14. minuteSleep_merged.csv\n","15. minuteStepsNarrow_merged.csv\n","16. minuteStepsWide_merged.csv\n","17. sleepDay_merged.csv\n","18. weightLogInfo_merged\n","\n","### Limitations for this data\n","\n","* Sample size: the dataset collects the information from 30 individuals, which is a small sample size to determine behavior patterns of a population of people who use smart devices\n","* The absence of essential characteristics of the participants might have a significant impact on the data collected, such as gender, age, and lifestyle\n","* Third-party data collected using Amazon Mechanical Turk.\n","* The data was collected six years ago. It is not as current as it could be for the analysis.\n","<br>"]},{"cell_type":"markdown","id":"d245208d","metadata":{"papermill":{"duration":0.104903,"end_time":"2023-02-27T17:06:56.802605","exception":false,"start_time":"2023-02-27T17:06:56.697702","status":"completed"},"tags":[]},"source":["## Environment\n","\n","R Studio was used to complete this analysis because it has many excellent data processing and visualization features."]},{"cell_type":"code","execution_count":1,"id":"6deb6333","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2023-02-27T17:06:57.018917Z","iopub.status.busy":"2023-02-27T17:06:57.015805Z","iopub.status.idle":"2023-02-27T17:08:00.307202Z","shell.execute_reply":"2023-02-27T17:08:00.305621Z"},"papermill":{"duration":63.399372,"end_time":"2023-02-27T17:08:00.307472","exception":false,"start_time":"2023-02-27T17:06:56.9081","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Warning message:\n","“unable to access index for repository http://cran.rstudio.com/src/contrib:\n","  cannot open URL 'http://cran.rstudio.com/src/contrib/PACKAGES'”\n","Warning message:\n","“package ‘ggpubr’ is not available for this version of R\n","\n","A version of this package for your version of R might be available elsewhere,\n","see the ideas at\n","https://cran.r-project.org/doc/manuals/r-patched/R-admin.html#Installing-packages”\n","── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3