lthy adults. \n","\n","* Users get 21.16 minutes of very active activity in a day or 148.12 minutes in a week. The CDC recommends at least 75–150 minutes of vigorous-intensity aerobic or an equivalent combination of moderate- and vigorous-intensity activity throughout the week. May increase moderate-intensity aerobic physical activity to more than 300 minutes or do more than 150 minutes of vigorous-intensity aerobic or an equivalent combination of moderate- and vigorous-intensity activity throughout the week for additional health benefits.\n","\n","* Participants are averaging 991.2 minutes, or 16.52 hours of sedentary time a day. Scientists have determined that should limit the amount of time spent being sedentary. Replacing sedentary time with physical activity of any intensity provides health benefits. And to help reduce the detrimental effects of high levels of sedentary behavior on health, all adults and older adults should aim to do more than the recommended levels of moderate- to vigorous-intensity physical activity.\n","\n","* This summary shows the average user is burning 2304 calories a day. Studies show that the number of calories you should burn in a day depends on your health and fitness goals, as well as other factors like your age, sex, height, weight, and activity levels. But on average, males and females need roughly 2,200–3,000 and 1,600–2,200 calories per day, respectively.\n","\n","* The summary of the sleep data shows the average user sleeps once per day for 419.2 minutes or 7 hours. That falls within the CDC’s recommendations for adults to get the proper amount of rest. The average user is spending 458.6 minutes in bed, or 7.6 hours. That means the typical user is spending 39.4 minutes awake in bed.\n","<br>"]},{"cell_type":"markdown","id":"4ed870ff","metadata":{"papermill":{"duration":0.16475,"end_time":"2023-02-27T17:08:38.55942","exception":false,"start_time":"2023-02-27T17:08:38.39467","status":"completed"},"tags":[]},"source":["## Visualization"]},{"cell_type":"code","execution_count":12,"id":"264ef9d7","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2023-02-27T17:08:38.893818Z","iopub.status.busy":"2023-02-27T17:08:38.892224Z","iopub.status.idle":"2023-02-27T17:08:38.94408Z","shell.execute_reply":"2023-02-27T17:08:38.942852Z"},"papermill":{"duration":0.220048,"end_time":"2023-02-27T17:08:38.944242","exception":false,"start_time":"2023-02-27T17:08:38.724194","status":"completed"},"tags":[]},"outputs":[],"source":["# Adding a column to dailyActivity  to sum all types of active minutes.\n","dailyActivity <- dailyActivity %>% \n","  mutate(ActiveMinutes = FairlyActiveMinutes + LightlyActiveMinutes + VeryActiveMinutes)\n","\n","# Adding a column with the day of the week to all data frames for further analysis.\n","dailyActivity$weekday <- wday(dailyActivity$ActivityDate, label=TRUE, abbr=FALSE)\n","sleepDay$weekday <- wday(sleepDay$SleepDay, label=TRUE, abbr=FALSE)\n","hourlyIntensities$weekday <- wday(hourlyIntensities$ActivityHour, label=TRUE, abbr=FALSE)"]},{"cell_type":"markdown","id":"5235cdfa","metadata":{"papermill":{"duration":0.165338,"end_time":"2023-02-27T17:08:39.274645","exception":false,"start_time":"2023-02-27T17:08:39.109307","status":"completed"},"tags":[]},"source":["### dailyActivity Data"]},{"cell_type":"code","execution_count":13,"id":"4ec53e15","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2023-02-27T17:08:39.613695Z","iopub.status.busy":"2023-02-27T17:08:39.61213Z","iopub.status.idle":"2023-02-27T17:08:40.344281Z","shell.execute_reply":"2023-02-27T17:08:40.343626Z"},"papermill":{"duration":0.903393,"end_time":"2023-02-27T17:08:40.344415","exception":false,"start_time":"2023-02-27T17:08:39.441022","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`summarise()` has grouped output by 'Id'. You can override using the `.groups` argument.\n","\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAA