s of active and sedentary minutes to compare them\n","activity_plotbar2 <- dailyActivity %>% \n","  group_by(Id) %>% \n","  summarise(variable = c(\"Fairly Active\", \"Lightly Active\",\"Very Active\", \"Sedentary\"),\n","            value_hrs = c(mean(FairlyActiveMinutes)/60,\n","                          mean(LightlyActiveMinutes)/60,\n","                          mean(VeryActiveMinutes)/60,\n","                          mean(SedentaryMinutes)/60))\n","\n","# plot1 Comparison between average Fairly Active, Lightly Active, Sedentary, and Very Active Hours\n","p1 <- ggplot(data = activity_plotbar2, aes(x = variable , y = value_hrs, fill = variable))+\n","      stat_summary(fun = \"mean\", geom = \"bar\")+\n","      theme(axis.ticks.x = element_blank(),\n","            axis.text.x = element_blank())+\n","      annotate(\"text\", x = 1, y = 1, label = \"0.22\")+\n","      annotate(\"text\", x = 2, y = 4, label = \"3.21\")+\n","      annotate(\"text\", x = 3, y = 17.5, label = \"16.52\")+\n","      annotate(\"text\", x = 4, y = 1.3, label = \"0.35\")+                  \n","      labs(title = \"Comparison between average Fairly Active, Lightly Active, Sedentary, and Very Active Hours\",\n","          x = \"Averages\", y = \"Hours\", fill = \"\")\n","ggdraw() +\n","draw_plot(p1, x = 0.2, y = 0, width = 0.5, height = 1) "]},{"cell_type":"markdown","id":"8665f00c","metadata":{"papermill":{"duration":0.166291,"end_time":"2023-02-27T17:08:40.678602","exception":false,"start_time":"2023-02-27T17:08:40.512311","status":"completed"},"tags":[]},"source":["The dataset reveals that the people spend most of their day sedentary with an average of 16 hours per day. On the other hand, they spend just around 4 hours active, which most of that active hours being lightly active."]},{"cell_type":"code","execution_count":14,"id":"b7896c52","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2023-02-27T17:08:41.020724Z","iopub.status.busy":"2023-02-27T17:08:41.019172Z","io