m_point(color = \"blue\")+\n","      geom_smooth(method = 'loess', formula = y ~ x)+\n","      labs(title = \"Total Steps vs. Calories\", x = \" Total Steps\", y = \"Calories\")\n","\n","# plot3 Total Distance vs. Calories\n","p3 <- ggplot(data = dailyActivity, aes(x = TotalDistance, y = Calories))+\n","      geom_point(color = \"blue\")+\n","      geom_smooth(method = 'loess', formula = y ~ x)+\n","      labs(title = \"Total Distance vs. Calories\", x = \"Total Distance\", y = \"Calories\")\n","\n","# plot4 Active Minutes vs. Calories\n","p4 <- ggplot(data = dailyActivity, aes(x = ActiveMinutes, y = Calories))+\n","      geom_point(color = \"blue\")+\n","      geom_smooth(method = 'loess', formula = y ~ x)+\n","      labs(title = \"Active Minutes vs. Calories\", x = \"Active Minutes\", y = \"Calories\")\n","\n","# plot5 Sedentary Minutes vs. Calories\n","p5 <- ggplot(data = dailyActivity, aes(x = SedentaryMinutes, y = Calories))+\n","      geom_point(color = \"blue\")+\n","      geom_smooth(method = 'loess', formula = y ~ x)+\n","      labs(title = \"Sedentary Minutes vs. Calories\", x = \"Sedentary Minutes\", y = \"Calories\")\n","\n","ggarrange(p2, p3, p4, p5, ncol = 2, nrow = 2)"]},{"cell_type":"markdown","id":"577e2249","metadata":{"papermill":{"duration":0.181019,"end_time":"2023-02-27T17:08:44.031297","exception":false,"start_time":"2023-02-27T17:08:43.850278","status":"completed"},"tags":[]},"source":["The above charts show that a person with higher active minutes tends to burn more calories in a day. The more time they spend inactive, the lower calories they are likely to burn.\n","There is also a positive correlation between Total Steps, Total Distance, and Calories, which is clear,  the more active the people are, the more calories they burn."]},{"cell_type":"code","execution_count":15,"id":"982d2546","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2023-02-27T17:08:44.396504Z","iopub.status.busy":"2023-02-27T17:08:44.39486Z","iopub.s