\"Total minutes in Bed\",\n","           y = \"Total minutes Asleep\")\n","\n","# dataframe plot12 calculate the average hours of asleep and time in bec\n","sleepDay_plotbar <- sleepDay %>% \n","  group_by(Id) %>% \n","  summarise(variable = c(\"TimeAsleep\", \"TimeInBed\"),\n","            value_hrs = c(mean(TotalMinutesAsleep)/60, mean(TotalTimeInBed)/60))\n","# plot12Average Time in Beb and Asleep\n","p12 <- ggplot(data = sleepDay_plotbar, aes(x = variable , y = value_hrs, fill = variable))+\n","      stat_summary(fun = \"mean\", geom = \"bar\")+\n","      labs(title = \"Average Time in Beb and Asleep\", x = \"Averages\", y = \"Hours\", fill = \"\")\n","\n","ggdraw() +\n","  draw_plot(p11, x = 0, y = 0, width = .5, height = 1) +\n","  draw_plot(p12, x = 0.6, y = 0, width = .4, height = 1)"]},{"cell_type":"markdown","id":"aa0d83b1","metadata":{"papermill":{"duration":0.203044,"end_time":"2023-02-27T17:08:49.968769","exception":false,"start_time":"2023-02-27T17:08:49.765725","status":"completed"},"tags":[]},"source":["There is a positive relationship between the minutes a person stays in bed and the minutes they sleep. The average amount of time seems to be very close, within a range of six to seven hours for both. That led to the conclusion that most of the time people are in bed; they are sleeping."]},{"cell_type":"code","execution_count":20,"id":"b03326cb","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2023-02-27T17:08:50.376796Z","iopub.status.busy":"2023-02-27T17:08:50.37462Z","iopub.status.idle":"2023-02-27T17:08:51.034123Z","shell.execute_reply":"2023-02-27T17:08:51.033497Z"},"papermill":{"duration":0.863872,"end_time":"2023-02-27T17:08:51.034299","exception":false,"start_time":"2023-02-27T17:08:50.170427","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Warning message:\n","“Ignoring unknown parameters: binwidth, bins, pad”\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAAALQCAIAAAAYV