er Days of the Week\",\n","           x = \"\", y = \"Average Asleep Hours\")\n","\n","# classification of sleep hours 360min=6hr, 480min=8hrs\n","sleepDay <- sleepDay %>% \n","  mutate( classification = case_when(\n","    TotalMinutesAsleep <= 360 ~ \"less than 6hrs\",\n","    TotalMinutesAsleep > 360 & TotalMinutesAsleep <= 480 ~ \"between 6 to 8hrs\",\n","    TRUE ~ \"more tha 8hrs\"))\n","# dataframe to calculate the percentage of each sleeper type\n","sleepDay_classification_plot <- sleepDay %>% \n","  group_by(classification) %>% \n","  count() %>% \n","  ungroup() %>% \n","  mutate(percentage = `n` / sum(`n`)) %>% \n","  mutate(labels = scales::percent(percentage))\n","# plot14 pie chart \n","p14 <- ggplot(sleepDay_classification_plot, aes(x = \"\", y = percentage, fill = classification)) +\n","      geom_col() +\n","      geom_label(aes(label = labels),\n","                 position = position_stack(vjust = 0.5),\n","                 show.legend = FALSE) +\n","      guides(fill = guide_legend(title = \"\")) +\n","      coord_polar(theta = \"y\") + \n","      theme_void()+\n","      labs(title = \"Sleeper type distribution\")+\n","      theme(plot.title = element_text(hjust = 0.5))\n","\n","ggdraw() +\n","  draw_plot(p13, x = 0, y = 0, width = .5, height = 1) +\n","  draw_plot(p14, x = 0.5, y = 0.1, width = .5, height = .8)"]},{"cell_type":"markdown","id":"3dc3e18e","metadata":{"papermill":{"duration":0.204645,"end_time":"2023-02-27T17:08:51.443122","exception":false,"start_time":"2023-02-27T17:08:51.238477","status":"completed"},"tags":[]},"source":["During the week, people tend to sleep more hours on Sunday, and they sleep less the rest of the days. \n","Approximately 50% of people have a good amount of sleep, between 6 and 8 hours. On average, almost 28% sleep more than 8 hours and 24% less than 6 hours."]},{"cell_type":"markdown","id":"9f645309","metadata":{"papermill":{"duration":0.20126,"end_time":"2023-02-27T17:08:51.847211","exception":false,"start_ti