fun = \"mean\", geom = \"bar\")+\n","      labs(title = \"Hours Active, Asleep, and Sedentary\", \n","           x = \"Averages\", y = \"Hours\", fill = \"\")\n","\n","#plot16 Very Active Minutes vs. Total Minutes Asleep\n","p16 <- ggplot(data = combined_data_plot, aes(x = VeryActiveMinutes , y = TotalMinutesAsleep))+\n","      geom_point(color = \"blue\")+\n","      geom_smooth(method = 'loess', formula = y ~ x)+\n","      labs(title = \"Very Active Minutes vs. Total Minutes Asleep\", \n","           x = \"Very Active Minutes\", y = \"Total Minutes Asleep\")\n","\n","#plot17 Sedentary Minutes vs. Total Minutes Asleep\n","p17 <- ggplot(data = combined_data_plot, aes(x = SedentaryMinutes , y = TotalMinutesAsleep))+\n","      geom_point(color = \"blue\")+\n","      geom_smooth(method = 'loess', formula = y ~ x)+\n","      labs(title = \"Sedentary Minutes vs. Total Minutes Asleep\", \n","           x = \"Sedentary Minutes\", y = \"Total Minutes Asleep\")\n","\n","ggdraw() +\n","  draw_plot(p15, x = 0.2, y = 0.6, width = .6, height = 0.4) +\n","  draw_plot(p16, x = 0, y = 0, width = .49, height = .55) +\n","  draw_plot(p17, x = .52, y = 0, width = .49, height = .55) "]},{"cell_type":"markdown","id":"39b34526","metadata":{"papermill":{"duration":0.213404,"end_time":"2023-02-27T17:08:54.238399","exception":false,"start_time":"2023-02-27T17:08:54.024995","status":"completed"},"tags":[]},"source":["These visualizations compare very active minutes and non-active minutes versus minutes asleep. The more time a person spends non-active, the lower the time they are sleeping. It is a negative relationship that implies non-activity negatively impacts sleep time. On the other hand, there is a more linear relationship between very active minutes and hours of sleep, tending to a more positive relationship as the time the person spends active increases. It seems to be when a person is more active, his sleep quality increases."]},{"cell_type":"markdown","id":"84a55b1a","metadata":{"pap