     geom_histogram(stat = \"identity\", fill = 'blue') +\n","      theme(axis.text.x = element_text(angle = 90)) +\n","      labs(title = \"Average Intensity per hour\",\n","           x = \"Hours\", y = \"Average Intensitiy\")\n","\n","ggarrange(p18, p19, ncol = 2, nrow = 1)"]},{"cell_type":"markdown","id":"04010aea","metadata":{"papermill":{"duration":0.219005,"end_time":"2023-02-27T17:08:56.57006","exception":false,"start_time":"2023-02-27T17:08:56.351055","status":"completed"},"tags":[]},"source":["The days with more activity during the week are Saturday and Tuesday, Sunday, on the contrary, being the day less active.\n","Throughout the day, people are more active between 6 to 22  hours, and peak activity happens between 17 to 19 hours. From 23 to 5 the activity decreases probably because at that hours people are sleeping. \n","<br>"]},{"cell_type":"markdown","id":"c1f7b5d3","metadata":{"papermill":{"duration":0.218203,"end_time":"2023-02-27T17:08:57.009014","exception":false,"start_time":"2023-02-27T17:08:56.790811","status":"completed"},"tags":[]},"source":["## Recommendations to business\n","\n","After analyzing FitBit Fitness Tracker Data is possible to use these insights to help influence Bellabeat marketing strategy.\n","* Bellabeat app can include alerts to warn the users when they accumulate a high number of sedentary minutes. Also, the Bellabeat app can make suggestions of activities to help the user to get more active. \n","* Encourage people to be more active, and since the most active time happens from 17-19, the Bellabeat app can set reminders to encourage people to train at that hours to increase. \n","* Encourage women to reach the goal of 10.000 steps per day. The Bellabeat app can set reminders of how many steps are missing to get 10.000 and motivate them with the benefits that reaching that goal implies to their health.\n","* Since Saturdays seem to be the more active day of the week, remind people to walk more long distances, train more time, or be more active in general this day.\n","* Sundays tend to be the most sedentary day of the week; because of this, the Bellabeat app can use this day to motivate people to do relaxing routines to be more active to begin the week. And guide them to their webpage, where they can learn how to construct a relaxing day.\n","* Bellabeat can also help women improve the quality of their sleep. A reminder can be set one hour before the set bedtime to help them get ready for bed.\n","* Encourage women who sleep less than six hours to be more active or reduce sedentary time during the day to help them sleep more hours and improve their sleep quality.\n","* Also, consider that more data is needed to support these insights because the correlation between some data does not mean causation. And invest in data which a greater sample size and more data from participants like age and gender to have more accurate predictions."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":124.293102,"end_time":"2023-02-27T17:08:57.338545","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-02-27T17:06:53.045443","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}